import { Component, useState } from "react";
import { NavLink } from "react-router-dom";
import useSignUpForm from "./CustomHooks";
const Register = () => {
    const { inputs, handleInputChange, handleSubmit } = useSignUpForm();
    console.log(inputs);
    return (
        <form className="container" onSubmit={handleSubmit}>
            <div className="row justify-content-center my-5 mt-5 pt-5">
                <div className="col-md-4 shadow my-auto">
                    <h4 className="my-4">Register Form</h4>
                    <div>
                        <label>First Name</label>
                        <input
                            type="text"
                            name="firstname"
                            onChange={handleInputChange}
                            value={inputs.firstname}
                            required
                        />
                        <label>Last Name</label>
                        <input
                            type="text"
                            name="lastname"
                            onChange={handleInputChange}
                            value={inputs.lastname}
                            required
                        />
                    </div>
                    <div>
                        <label>Email Address</label>
                        <input
                            type="email"
                            name="email"
                            onChange={handleInputChange}
                            value={inputs.email}
                            required
                        />
                    </div>
                    <div>
                        <label>Password</label>
                        <input
                            type="password"
                            name="password1"
                            onChange={handleInputChange}
                            value={inputs.password}
                        />
                    </div>

                    <div className="form-group">
                        <button className="w-100 btn btn-lg btn-primary">
                            Sign In
                        </button>
                    </div>
                    <div className="px-2 font-bold py-2 ">
                        <NavLink to="/login" className="font-weight-bold">
                            Login
                        </NavLink>
                    </div>
                </div>
            </div>
        </form>
    );
};
export default Register;
